import * as React from 'react';
import './numbers.css';

export class Numbers extends React.Component{
    constructor(){
      super(props);
    }
    render() {
        return (
          <div>
            <div style={{flex: 2}}>
            </div>
            <div className="container content" style={{flex: 8}}>
              <div className="item col">
                <h2 className="number">+100</h2>
                <p className="description">Startups<br />parceiras</p>
              </div>
              <div className="item col">
                <h2 className="number">+15k</h2>
                <p className="description">Alunos<br />impactados</p>
              </div>
              <div className="item col">
                <h2 className="number">+45k</h2>
                <p className="description">Inscritos nos<br />cursos online</p>
              </div>
              <div className="item col">
                <h2 className="number">+20</h2>
                <p className="description">Startups<br />criadas</p>
              </div>
            </div>
            <div style={{flex: 2}}>
            </div>
          </div>
        )
  }
}
